import React from 'react';
import { View, Image, Text } from 'react-native';
import { RectButton } from 'react-native-gesture-handler';

import heartOutlineIcon from '../../assets/images/icons/heart-outline.png';
import unfavoriteIcon from '../../assets/images/icons/unfavorite.png';
import whatsappIcon from '../../assets/images/icons/whatsapp.png';

import styles from './styles';

function TeacherItem () {
    return (
        <View style={styles.container}>
            <View style={styles.profile}>
                <Image 
                    style={styles.avatar}
                    source={{ uri: 'https://avatars2.githubusercontent.com/u/57998394?s=460&u=2b34d3d7ca49962202df29cf5001f452827bdf67&v=4'}}    
                />

                <View style={styles.profileInfo}>
                    <Text style={styles.name}>Diego</Text>
                    <Text style={styles.subject}></Text>
                </View>
            </View>

            <Text style={styles.bio}>
            Sou estudante de tecnologia da informação e busco me aperfeiçoar a cada dia, já desenvolvi alguns projetos 
            {'\n'}{'\n'}
            particulares em javascript e php básico. Estou em constante aprendizado sobre as atualidades de tecnologias.
            </Text>

            <View style={styles.footer}>
                <Text style={styles.price}>
                    Preço/hora { ' ' }
                    <Text style={styles.priceValue}>R$20,00</Text>
                </Text>

                <View style={styles.buttonsContainer}>
                    <RectButton style={styles.favoriteButton}>
                        <Image source={heartOutlineIcon} />
                    </RectButton>

                    <RectButton style={styles.contactButton}>
                        <Image source={whatsappIcon} />
                        <Text style={styles.contatcButtonText}>Entrar em contato</Text>
                    </RectButton>

                </View>
            </View>
        </View>
    )   
}

export default TeacherItem
